export function MemoryResource() {
    return <div>
        <h2>Memory Resource</h2>
        <p>In computing, memory is a temporary storage area for data and instructions that the CPU processes. It's also known as RAM (random access memory). Memory is volatile, meaning that data is lost when the computer is turned off.</p>
    </div>
}

export default function NetworkBandwithResource() {
    return <div>
        <h2>Network Bandwith Resource</h2>
        <p>Network bandwidth, also known as data transfer rate, is the maximum amount of data that can be received by a network user at a given time. It's usually measured in megabits per second (Mbps).</p>
    </div>
}
